<ol>
<li>I have two schema set up: Events and a sub-doc schema Categories (among others).</li>
<li>The function pulls in array which contains the data needed to create several categories (this bit works) as well as the Event ID appended to the end.</li>
<li>The first few bits below just grab that ID, then remove it from the array (probably a better way to do this, but again, it works).</li>
<li>As mentioned above, the Categories then create correctly (and even do validation), which is amazing, BUT...</li>
<li>They don't get appended to the Event doc. The doc updates the &quot;categories&quot; field to an applicable number of &quot;null&quot; values, but I cannot for the life of me get it to actually take the IDs of the newly created categories.</li>
</ol>
<p>I nabbed (and adjusted) the below code from somewhere, so this is where I'm at...</p>
<pre><code>     exports.addCategories = catchAsync(async (req, res, next) =&gt; {
       const categories = req.body;
       const length = categories.length;
       const eventID = categories[length - 1].eventId;
       categories.pop();

    Event.findOne({ _id: eventID }, (err, event) =&gt; {
      if (err) return res.status(400).send(err);
      if (!event)
        return res.status(400).send(new Error(&quot;Could not find that event&quot;));

    Category.create(categories, (err, category) =&gt; {
      if (err) return res.status(400).send(err);

      event.categories.push(category._id);
      event.save((err) =&gt; {
        if (err) return res.status(400).send(err);

        res.status(200).json(category);
        });
      });
     });
    });
</code></pre>
<p>Currently the mongoose debug output is showing the following (which confirms that MOST of it is working, but the IDs just aren't being pulled correctly):</p>
<pre><code>&gt; Mongoose: events.updateOne({ _id: ObjectId(&quot;614bc221bc067e62e0790875&quot;)}, { '$push': { categories: { '$each': [ undefined ] } }, '$inc': { __v: 1 }}, { session: undefined })
</code></pre>

