Infinite loading on middleware when applying it to a post route<p>Ok so I've made a middleware that checks if the user has already submitted their data to a form, and if true; redirects them to an error page and a link to access their previous results if they wish to do that.
Here is the middleware I've written:</p>
<pre><code>     module.exports.isRevisit = async (req, res, next) =&gt; {
          const visitors = await Visitor.find({});
          for (const visitor in visitors) {
            if (visitor.session === visitors.session) {
              const redirectedVisitor = visitors[visitor];
              return res.render(&quot;error&quot;, { redirectedVisitor });
            } else {
              next();
            }
          }
        };
</code></pre>
<p>and here is the route on which I've put my middleware:</p>
<pre><code>app.post(&quot;/home&quot;, isRevisit, async (req, res, next) =&gt; {
  const date = new Date();
  const today = date.getDate();
  const visitor = new Visitor({
    input: req.body.input,
    Date: today,
    session: req.sessionID,
  });

  await visitor.save();
  const goodVisitorsCount = await Visitor.count({ input: &quot;good&quot;, Date: today });
  const badVisitorsCount = await Visitor.count({ input: &quot;bad&quot;, Date: today });
  const allVisitorsCount = await Visitor.count({});
  //console.log(visitor.session);
  res.render(`GoodOrBad/${req.body.input}`, {
    goodVisitorsCount,
    badVisitorsCount,
    allVisitorsCount,
  });


});
</code></pre>
<p>Now when I hit the post route as a user who has yet to input their data for the first time. The page loads infinitely, but the middleware works and prevents any user from tampering with the form again. Any way to fix this? I'm super lost on this one. This is my first project using express, mongoose, and node.js!</p>

